import com.advancedspark.serving.spark.Dynomite

val topKItemsByRating = enrichedItemRatingsCountDF.select($"items.itemId").limit(5)

// Convert Row -> itemId
val topK = topKItemsByRating.map(row => {
  row.getLong(0)
}).collect()

Dynomite.client.set("topk", topK.mkString(","))

val topk = Dynomite.client.get("topk")
